import React from "react";
import './about.scss';

const About = () => {
    return (
        <div className="about">
            <div></div>
            <p className="intro">
                I am Soomin Chung, a designer and student at School of the Art Institute of Chicago. 
            </p>
        </div>
    );
};

export default About;
